import React, { useState } from "react";
import { HashLink as Link } from "react-router-hash-link";

const navLinks = [
  { to: "#", text: "Home" },
  { to: "#access", text: "About Us" },
  { to: "#solutions", text: "Solutions" },
  { to: "#images", text: "images/logo 1.png", isImage: true },
  { to: "#blogs", text: "Blogs" },
  { to: "#trails", text: "Trails" },
  { to: "#contact", text: "Contact Us" },
];

const Header = () => {
  const [isMenuOpen, setIsMenuOpen] = useState(false);

  const toggleMenu = () => {
    setIsMenuOpen(!isMenuOpen);
  };

  return (
    <div>
      <div
        className={`flex gap-16 text-white justify-between items-center p-6 fixed bg-[#392B85] w-full z-20 cursor-pointer`}
      >
        <div className="flex items-center">
          {navLinks.map((link, index) => (
            <Link key={index} to={link.to} smooth>
              {link.isImage ? (
                <img src={link.text} alt="logo" className="h-8 w-auto mr-4" />
              ) : (
                <span className="contrast-75">{link.text}</span>
              )}
            </Link>
          ))}
        </div>
        <button onClick={toggleMenu} className="lg:hidden">
          â˜°
        </button>
        {isMenuOpen && (
          <div className="lg:hidden absolute top-16 right-6 bg-white p-2 rounded shadow">
            {navLinks.map((link, index) => (
              <Link
                key={index}
                to={link.to}
                smooth
                className="block py-2 hover:text-[#392B85]"
              >
                {link.text}
              </Link>
            ))}
          </div>
        )}
      </div>
    </div>
  );
};

export default Header;
